import { videoService } from '../services/videoService'

const _setVideosList = (name) => ({ type: 'SET_LIST', name })

export default function setVideos(name) {
    return async (dispatch) => {
        const results = await videoService.query(name)
        dispatch(_setVideosList(results))
    }
}
